import React from "react";
import { BrowserRouter as Switch, Route } from "react-router-dom";
import Layout from "./components/Layout";
import posts from "./view/Posts/Home";

const Routes = () => {
  return (
    <Layout>
      <Switch>
        <Route path="/" component={posts} />
      </Switch>
    </Layout>
  );
};

export default Routes;
